                  <label>Subject</label>
                  <input type="text"></input>

                  <label>Message</label>
                  <textarea rows="6" placeholder="Type your massage here">
                  </textarea>
                  <button className="btn">Submit</button>
                </form>
  </div>
  )
}

export default Contact
